import React, { useState } from "react";
import { motion, AnimatePresence } from "framer-motion"; // Import Framer Motion
import "./App.css";

const App = () => {
  const [menuOpen, setMenuOpen] = useState(false);
  const [activeTab, setActiveTab] = useState("Home");

  const renderContent = () => {
    switch (activeTab) {
      case "Home":
        return <UpcomingInterviews />;
      case "Interviewers":
        return <InterviewersTable />;
      case "Candidates":
        return <CandidatesTable />;
      case "Reports":
        return <Reports />;
      case "Settings":
        return <Settings />;
      default:
        return <UpcomingInterviews />;
    }
  };

  const handleMenuToggle = () => {
    setMenuOpen(!menuOpen);
  };

  return (
    <div className="app-container">
      <h1 className="dashboard-title">Interview Management Dashboard</h1>

      {/* Navigation Bar */}
      <nav className={`navbar ${menuOpen ? "open" : ""}`}>
        <div className="hamburger" onClick={handleMenuToggle}>
          <span className="bar"></span>
          <span className="bar"></span>
          <span className="bar"></span>
        </div>
        <div className="menu">
          {["Home", "Interviewers", "Candidates", "Reports", "Settings"].map((tab) => (
            <div
              key={tab}
              className={`nav-item ${activeTab === tab ? "active" : ""}`}
              onClick={() => {
                setActiveTab(tab);
                setMenuOpen(false); // Close the menu after clicking on a tab
              }}
            >
              {tab}
            </div>
          ))}
        </div>
      </nav>

      {/* Animate content when switching tabs */}
      <AnimatePresence exitBeforeEnter>
        <motion.div
          key={activeTab}
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          exit={{ opacity: 0, y: -20 }}
          transition={{ duration: 0.4 }}
          className="content"
        >
          {renderContent()}
        </motion.div>
      </AnimatePresence>
    </div>
  );
};

// Components for different tabs
const UpcomingInterviews = () => (
  <div className="upcoming-interviews">
    <h2>Upcoming Interviews</h2>
    <ul>
      <li>Interview with John Doe</li>
      <li>Interview with Jane Smith</li>
    </ul>
  </div>
);

const InterviewersTable = () => (
  <div className="table-container">
    <h2>Interviewers</h2>
    <table>
      <thead>
        <tr>
          <th>Name</th>
          <th>Email ID</th>
          <th>More Details</th>
        </tr>
      </thead>
      <tbody>
        <tr>
          <td>Dr. Alice Johnson</td>
          <td>alice@example.com</td>
          <td><button>Details</button></td>
        </tr>
        <tr>
          <td>Mr. Bob Lee</td>
          <td>bob@example.com</td>
          <td><button>Details</button></td>
        </tr>
      </tbody>
    </table>
  </div>
);

const CandidatesTable = () => (
  <div className="table-container">
    <h2>Candidates</h2>
    <table>
      <thead>
        <tr>
          <th>Name</th>
          <th>Email ID</th>
          <th>More Details</th>
        </tr>
      </thead>
      <tbody>
        <tr>
          <td>Emily Davis</td>
          <td>emily@example.com</td>
          <td><button>Details</button></td>
        </tr>
        <tr>
          <td>Mark Brown</td>
          <td>mark@example.com</td>
          <td><button>Details</button></td>
        </tr>
      </tbody>
    </table>
  </div>
);

const Reports = () => (
  <div className="reports">
    <h2>Reports</h2>
    <ul>
      <li>Total Interviews: 10</li>
      <li>Upcoming Interviews: 2</li>
      <li>Completed Interviews: 8</li>
    </ul>
  </div>
);

const Settings = () => (
  <div className="settings">
    <h2>Settings</h2>
    <p>Change Theme: Light / Dark</p>
  </div>
);

export default App;
